import "./Login.scss";

const Login = () => {
  return (
    <div className="login">
      <div className="card">
        <div className="left">
            <h1>Hello World.</h1>
            <p>lorem20</p>
        </div>
        <div className="right"></div>
      </div>
    </div>
  );
};

export default Login;
